import './PossibleTrip.css';

function PossibleTrip({ name, drivingTime }) {

    return (
        <div className='trip-main'>
            <h1 class="head">{name}</h1>
            <br> </br>
            <p>{name}, {drivingTime} drive.</p>
        </div>
    )
}

export default PossibleTrip;
